gw0(){return"\u0397 Margaret Whitehead \u03c0\u03c1\u03bf\u03c9\u03b8\u03b5\u03af \u03c4\u03b7 \u03c3\u03c5\u03b6\u03ae\u03c4\u03b7\u03c3\u03b7 \u03b3\u03b9\u03b1 \u03c4\u03b7\u03bd \u03ad\u03bd\u03bd\u03bf\u03b9\u03b1 \u03c4\u03bf\u03c5 \u03a6\u03c5\u03c3\u03b9\u03ba\u03bf\u03cd \u0391\u03bb\u03c6\u03b1\u03b2\u03b7\u03c4\u03b9\u03c3\u03bc\u03bf\u03cd."},
