gwR(){return"\u039a\u03b1\u03bb\u03ce\u03c2 \u03ae\u03c1\u03b8\u03b1\u03c4\u03b5 \u03c3\u03c4\u03b7\u03bd \u03c0\u03c1\u03cc\u03ba\u03bb\u03b7\u03c3\u03b7 7. \u0398\u03b1 \u03c3\u03b1\u03c2 \u03b4\u03bf\u03b8\u03bf\u03cd\u03bd \u03c3\u03b5\u03bd\u03ac\u03c1\u03b9\u03b1 \u03c0\u03bf\u03c5 \u03b1\u03bd\u03c4\u03b9\u03c0\u03c1\u03bf\u03c3\u03c9\u03c0\u03b5\u03cd\u03bf\u03c5\u03bd \u03c4\u03b1 \u03b5\u03c0\u03af\u03c0\u03b5\u03b4\u03b1 \u03c0\u03c1\u03bf\u03cc\u03b4\u03bf\u03c5 \u03c4\u03b7\u03c2 \u03b1\u03b8\u03bb\u03b7\u03c4\u03b9\u03ba\u03ae\u03c2 \u03c0\u03c1\u03b1\u03ba\u03c4\u03b9\u03ba\u03ae\u03c2 \u03b5\u03bd\u03cc\u03c2 \u03bc\u03b1\u03b8\u03b7\u03c4\u03ae \u03c3\u03b5 \u03c3\u03c7\u03ad\u03c3\u03b7 \u03bc\u03b5 \u03c4\u03b9\u03c2 \u03c4\u03ad\u03c3\u03c3\u03b5\u03c1\u03b9\u03c2 \u03b4\u03b9\u03b1\u03c3\u03c4\u03ac\u03c3\u03b5\u03b9\u03c2 \u03c3\u03c9\u03bc\u03b1\u03c4\u03b9\u03ba\u03bf\u03cd \u03b3\u03c1\u03b1\u03bc\u03bc\u03b1\u03c4\u03b9\u03c3\u03bc\u03bf\u03cd (\u03c3\u03c9\u03bc\u03b1\u03c4\u03b9\u03ba\u03ae, \u03c3\u03c5\u03bd\u03b1\u03b9\u03c3\u03b8\u03b7\u03bc\u03b1\u03c4\u03b9\u03ba\u03ae, \u03ba\u03bf\u03b9\u03bd\u03c9\u03bd\u03b9\u03ba\u03ae \u03ba\u03b1\u03b9 \u03b3\u03bd\u03c9\u03c3\u03c4\u03b9\u03ba\u03ae). \u0393\u03b9\u03b1 \u03ba\u03ac\u03b8\u03b5 \u03c3\u03b5\u03bd\u03ac\u03c1\u03b9\u03bf, \u03c0\u03c1\u03ad\u03c0\u03b5\u03b9 \u03bd\u03b1 \u03b2\u03c1\u03b5\u03af\u03c4\u03b5 \u03c4\u03bf \u03c3\u03c9\u03c3\u03c4\u03cc \u03b5\u03c0\u03af\u03c0\u03b5\u03b4\u03bf \u03c0\u03c1\u03bf\u03cc\u03b4\u03bf\u03c5 \u03c3\u03cd\u03c1\u03bf\u03bd\u03c4\u03b1\u03c2 \u03c4\u03bf \u03c3\u03b5\u03bd\u03ac\u03c1\u03b9\u03bf \u03c3\u03c4\u03bf \u03c3\u03c9\u03c3\u03c4\u03cc \u03b5\u03c0\u03af\u03c0\u03b5\u03b4\u03bf. \u0388\u03c4\u03bf\u03b9\u03bc\u03bf\u03b9;"},
