gz2(){return"\u039f \u03bc\u03b1\u03b8\u03b7\u03c4\u03ae\u03c2 \u03b4\u03b5\u03bd \u03b3\u03bd\u03c9\u03c1\u03af\u03b6\u03b5\u03b9 \u03c4\u03bf\u03c5\u03c2 \u03ba\u03b1\u03bd\u03cc\u03bd\u03b5\u03c2 \u03c4\u03bf\u03c5 \u03b1\u03b3\u03ce\u03bd\u03b1 \u03bc\u03c0\u03ac\u03c3\u03ba\u03b5\u03c4 \u03ba\u03b1\u03b9 \u03b4\u03b5\u03bd \u03b3\u03bd\u03c9\u03c1\u03af\u03b6\u03b5\u03b9 \u03c4\u03b1 \u03bf\u03c6\u03ad\u03bb\u03b7 \u03b3\u03b9\u03b1 \u03c4\u03b7\u03bd \u03c5\u03b3\u03b5\u03af\u03b1 \u03c0\u03bf\u03c5 \u03c3\u03c7\u03b5\u03c4\u03af\u03b6\u03bf\u03bd\u03c4\u03b1\u03b9 \u03bc\u03b5 \u03c4\u03b7\u03bd \u03b1\u03b8\u03bb\u03b7\u03c4\u03b9\u03ba\u03ae \u03c0\u03c1\u03b1\u03ba\u03c4\u03b9\u03ba\u03ae (\u03b3\u03bd\u03c9\u03c3\u03c4\u03b9\u03ba\u03ae \u03b4\u03b9\u03ac\u03c3\u03c4\u03b1\u03c3\u03b7)."},
gz1(){return"\u039f \u03bc\u03b1\u03b8\u03b7\u03c4\u03ae\u03c2 \u03b4\u03b5\u03bd \u03b8\u03ad\u03bb\u03b5\u03b9 \u03bd\u03b1 \u03c3\u03c5\u03bc\u03bc\u03b5\u03c4\u03ac\u03c3\u03c7\u03b5\u03b9 \u03c3\u03c4\u03b1 \u03bc\u03b1\u03b8\u03ae\u03bc\u03b1\u03c4\u03b1 \u0391\u039c \u03c3\u03c4\u03bf \u03c3\u03c7\u03bf\u03bb\u03b5\u03af\u03bf \u03b5\u03c0\u03b5\u03b9\u03b4\u03ae \u03b4\u03b5\u03bd \u03ad\u03c7\u03b5\u03b9 \u03b1\u03c5\u03c4\u03bf\u03c0\u03b5\u03c0\u03bf\u03af\u03b8\u03b7\u03c3\u03b7 \u03ae \u03b4\u03b5\u03bd \u03ad\u03c7\u03b5\u03b9 \u03b1\u03c1\u03ba\u03b5\u03c4\u03ac \u03ba\u03af\u03bd\u03b7\u03c4\u03c1\u03b1 (\u03c3\u03c5\u03bd\u03b1\u03b9\u03c3\u03b8\u03b7\u03bc\u03b1\u03c4\u03b9\u03ba\u03ae \u03b4\u03b9\u03ac\u03c3\u03c4\u03b1\u03c3\u03b7)."},
gz3(){return"\u039f \u03bc\u03b1\u03b8\u03b7\u03c4\u03ae\u03c2 \u03b4\u03b5\u03bd \u03ad\u03c7\u03b5\u03b9 \u03c3\u03c7\u03ad\u03c3\u03b5\u03b9\u03c2 \u03c0\u03bf\u03c5 \u03c4\u03bf\u03bd \u03b4\u03b9\u03b5\u03b3\u03b5\u03af\u03c1\u03bf\u03c5\u03bd \u03ba\u03b1\u03b9 \u03c4\u03bf\u03bd \u03c5\u03c0\u03bf\u03c3\u03c4\u03b7\u03c1\u03af\u03b6\u03bf\u03c5\u03bd \u03c3\u03c4\u03b7 \u03c3\u03c5\u03bc\u03bc\u03b5\u03c4\u03bf\u03c7\u03ae \u03c3\u03b5 \u03b5\u03be\u03c9\u03c3\u03c7\u03bf\u03bb\u03b9\u03ba\u03ad\u03c2 \u03b1\u03b8\u03bb\u03b7\u03c4\u03b9\u03ba\u03ad\u03c2 \u03b4\u03c1\u03b1\u03c3\u03c4\u03b7\u03c1\u03b9\u03cc\u03c4\u03b7\u03c4\u03b5\u03c2 (\u03ba\u03bf\u03b9\u03bd\u03c9\u03bd\u03b9\u03ba\u03ae \u03b4\u03b9\u03ac\u03c3\u03c4\u03b1\u03c3\u03b7)."},
gyd(){return"\u039f \u03bc\u03b1\u03b8\u03b7\u03c4\u03ae\u03c2 \u03b1\u03bd\u03b1\u03c0\u03c4\u03cd\u03c3\u03c3\u03b5\u03b9 \u03b2\u03b1\u03c3\u03b9\u03ba\u03ad\u03c2 \u03ba\u03b9\u03bd\u03b7\u03c4\u03b9\u03ba\u03ad\u03c2 \u03b4\u03b5\u03be\u03b9\u03cc\u03c4\u03b7\u03c4\u03b5\u03c2 \u03c3\u03c4\u03bf \u03b2\u03cc\u03bb\u03b5\u03ca \u03ba\u03b1\u03b9 \u03ad\u03c7\u03b5\u03b9 \u03bc\u03b5\u03b3\u03b1\u03bb\u03cd\u03c4\u03b5\u03c1\u03b7 \u03b5\u03c0\u03af\u03b3\u03bd\u03c9\u03c3\u03b7 \u03c4\u03c9\u03bd \u03b4\u03b9\u03ba\u03ce\u03bd \u03c4\u03bf\u03c5 \u03c6\u03c5\u03c3\u03b9\u03ba\u03ce\u03bd \u03b9\u03ba\u03b1\u03bd\u03bf\u03c4\u03ae\u03c4\u03c9\u03bd (\u03c3\u03c9\u03bc\u03b1\u03c4\u03b9\u03ba\u03ae \u03b4\u03b9\u03ac\u03c3\u03c4\u03b1\u03c3\u03b7)."},
