gvK(){return"\u039a\u03b1\u03bb\u03ce\u03c2 \u03ae\u03c1\u03b8\u03b1\u03c4\u03b5 \u03c3\u03c4\u03b7\u03bd \u03c0\u03c1\u03cc\u03ba\u03bb\u03b7\u03c3\u03b7 10. \u03a4\u03bf \u03c6\u03ac\u03c3\u03bc\u03b1 \u03c4\u03c9\u03bd \u03bc\u03bf\u03c1\u03c6\u03ce\u03bd \u03b4\u03b9\u03b4\u03b1\u03c3\u03ba\u03b1\u03bb\u03af\u03b1\u03c2 \u03c4\u03b7\u03c2 Mosston \u03b5\u03af\u03bd\u03b1\u03b9 \u03ad\u03bd\u03b1 \u03c0\u03bb\u03b1\u03af\u03c3\u03b9\u03bf \u03c0\u03bf\u03c5 \u03ba\u03b1\u03c4\u03b7\u03b3\u03bf\u03c1\u03b9\u03bf\u03c0\u03bf\u03b9\u03b5\u03af \u03c4\u03b1 \u03c3\u03c4\u03c5\u03bb \u03b4\u03b9\u03b4\u03b1\u03c3\u03ba\u03b1\u03bb\u03af\u03b1\u03c2 \u03bc\u03b5 \u03b2\u03ac\u03c3\u03b7 \u03c4\u03bf\u03bd \u03b2\u03b1\u03b8\u03bc\u03cc \u03b5\u03be\u03bf\u03c5\u03c3\u03af\u03b1\u03c2 \u03bb\u03ae\u03c8\u03b7\u03c2 \u03b1\u03c0\u03bf\u03c6\u03ac\u03c3\u03b5\u03c9\u03bd \u03c0\u03bf\u03c5 \u03b4\u03af\u03bd\u03b5\u03c4\u03b1\u03b9 \u03c3\u03c4\u03bf\u03bd \u03b4\u03ac\u03c3\u03ba\u03b1\u03bb\u03bf \u03ba\u03b1\u03b9 \u03c4\u03bf\u03bd \u03b5\u03ba\u03c0\u03b1\u03b9\u03b4\u03b5\u03c5\u03cc\u03bc\u03b5\u03bd\u03bf. \u03a4\u03bf \u03c6\u03ac\u03c3\u03bc\u03b1 \u03b1\u03c0\u03bf\u03c4\u03b5\u03bb\u03b5\u03af\u03c4\u03b1\u03b9 \u03b1\u03c0\u03cc 11 \u03c3\u03c4\u03c5\u03bb \u03b4\u03b9\u03b4\u03b1\u03c3\u03ba\u03b1\u03bb\u03af\u03b1\u03c2, \u03c0\u03bf\u03c5 \u03ba\u03c5\u03bc\u03b1\u03af\u03bd\u03bf\u03bd\u03c4\u03b1\u03b9 \u03b1\u03c0\u03cc \u03c0\u03b5\u03c1\u03b9\u03c3\u03c3\u03cc\u03c4\u03b5\u03c1\u03b1 \u0394\u03b1\u03c3\u03ba\u03b1\u03bb\u03bf\u03ba\u03b5\u03bd\u03c4\u03c1\u03b9\u03ba\u03ad\u03c2 \u03ad\u03c9\u03c2 \u03c0\u03b9\u03bf \u03bc\u03b1\u03b8\u03b7\u03c4\u03bf\u03ba\u03b5\u03bd\u03c4\u03c1\u03b9\u03ba\u03ad\u03c2 \u03c0\u03c1\u03bf\u03c3\u03b5\u03b3\u03b3\u03af\u03c3\u03b5\u03b9\u03c2 \u0394\u03b9\u03b1\u03b2\u03ac\u03c3\u03c4\u03b5 \u03c4\u03b9\u03c2 \u03b5\u03bd\u03b4\u03b5\u03af\u03be\u03b5\u03b9\u03c2 \u03ba\u03b1\u03b9 \u03c0\u03c1\u03bf\u03c3\u03b4\u03b9\u03bf\u03c1\u03af\u03c3\u03c4\u03b5 \u03c4\u03bf \u03c3\u03c7\u03b5\u03c4\u03b9\u03ba\u03cc \u03c3\u03c4\u03c5\u03bb \u03b4\u03b9\u03b4\u03b1\u03c3\u03ba\u03b1\u03bb\u03af\u03b1\u03c2 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03bb\u03cd\u03c3\u03b5\u03c4\u03b5 \u03c4\u03bf \u03c0\u03b1\u03b6\u03bb. \u0388\u03c4\u03bf\u03b9\u03bc\u03bf\u03b9;"},
